class CHOOSE_OBJECT():
    step_name = 'CHOOSE_OBJECT'

    def __init__(self):
        print(f'Registering {self.step_name} step')

    def predict(self,img,obj1,obj2):
        prompt1 = f'Tell me the attributes of the {obj1} in one sentence.'
        prompt2 = f'Tell me the attributes of the {obj2} in one sentence.'
        obj_desc1 = API.gpt3(prompt1, 'gpt3_general')
        obj_desc2 = API.gpt3(prompt2, 'gpt3_general')
        result1 = API.clip(img,obj_desc1)
        result2 = API.clip(img,obj_desc2)
        if result1 > result2:
            result = obj1
        else:
            result = obj2
        return result

    def execute(self,img,obj1,obj2):
        result = self.predict(img,obj1,obj2)
        return result
